package com.corejava_program;

public class Division {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a = 5;
		int b =10;
		int c = 100;
		
		int D = a/2;
		int D1= b/5;
		int D3 = c/10;
		
		System.out.println("Division of D is "+ D);
		System.out.println("Division of D1 is "+ D1);
		System.out.println("Division of D3 is "+ D3);
		

	}

}
